import styled from 'styled-components';

export const StyledRegister = styled.div`
  width: 100vw;
  height: 100vh;
`;

export const Logo = styled.img`
  height: 25px;
  margin-right: 2.8rem;
  cursor: pointer;
`;

export const LoginBtn = styled.button``;
